import React from "react";
import VideoThumbnail from './video-thumbnail';
import '../images';

import vid1 from "../images/video1.jpg";
import vid2 from "../images/video2.jpg";
import vid3 from "../images/video3.jpg";
import vid4 from "../images/video4.jpg";
import vid5 from "../images/video5.jpg";
import vid6 from "../images/video6.jpg";
import vid7 from "../images/video7.jpg";
import vid8 from "../images/video8.jpg";

const menuVideo = [
  {
    imagen: vid1
  },
  {
    imagen: vid2
  },
  {
    imagen: vid3
  },
  {
    imagen: vid4
  },
  {
    imagen: vid5
  },
  {
    imagen: vid6
  },
  {
    imagen: vid7
  },
  {
    imagen: vid8
  }
];

export function ThumbContainer() {
  return <div className="thumb-container">
    <VideoThumbnail img = {video1.jpg}/>
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
  </div>;
}
